import React from 'react';

const Start_New_Topic = () => {

    return (
        <div>
            <input type="text" placeholder="Započni novu temu" title="Molim vas, proverite prvo u listi sa leve strane da li tema koju pokrećete već postoji"/>
            <input type="text" placeholder="Ostavite prvu poruku na vašoj novoj temi"/>
            <input type="submit" value="Započni novu temu"/>
        </div>
    )
}

export default Start_New_Topic;
